import React, { Component } from 'react';
import StudentLayout from './StudentLayout';
import Header from '../../components/student/header/Header';

class StudentPage extends Component {
    render() {
        return (
            <div>
                <Header />
                <StudentLayout />
            </div>
        );
    }
}

export default StudentPage;
